import React from "react";
import { Switch, Route } from "react-router-dom";
import LandingPage from "./Landing";
import About from "./About";
import Contact from "./Contact";
import Projects from "./Projects";
import Resume from "./Resume";
import Stars from "./Stars";
import Strange from "./projects/Strange";
import Sketchup from "./projects/Sketchup";
import Shoot from "./projects/Shoot";
import Grimeton from "./projects/Grimeton";
import Falcon from "./projects/Falcon";
import Cosmos from "./projects/Cosmos";
import Archrenderings from "./projects/Archrenderings";
import Block from "./projects/Block";

const Main = () => (
  <Switch>
    <Route exact path="/" component={LandingPage} />
    <Route exact path="/about" component={About} />
    <Route exact path="/contact" component={Contact} />
    <Route exact path="/projects" component={Projects} />
    <Route exact path="/resume" component={Resume} />
    <Route exact path="/stars" component={Stars} />
    <Route exact path="/projects/strange" component={Strange} />
    <Route exact path="/projects/shoot" component={Shoot} />
    <Route exact path="/projects/sketchup" component={Sketchup} />
    <Route exact path="/projects/grimeton" component={Grimeton} />
    <Route exact path="/projects/falcon" component={Falcon} />
    <Route exact path="/projects/cosmos" component={Cosmos} />
    <Route exact path="/projects/arch" component={Archrenderings} />
    <Route exact path="/projects/block" component={Block} />
  </Switch>
);

export default Main;
